import Shell from "./Shell";
import { CardContent, Container, useTheme } from "@mui/material";
import store from "../../store";
// import { useTheme } from "react";
import { getState } from "redux";
function Policies() {
  const theme = useTheme;

  const properties = {
    policyContainer: {},
  };
  const styles = (theme) => ({
    cardContent: {
      display: "flex",
      flexDirection: "column",
      width: "80%",
      [theme.breakpoints.up("sm")]: {
        justifyContent: "center",
      },
    },
  });

  return (
    <Shell
      heading="Policies"
      index={4}
      content={
        // store.getState().policies.map((policy) => (
        //   <p>{policy.policy}</p>
        // ))
        <CardContent sx={styles(theme).cardContent}>
          <Container
            {...properties.policyContainer}
            sx={styles(theme).businessContainer}
          >
            {store.getState().policies.map((policy) => (
              <p>{policy.policy}</p>
            ))}
          </Container>
        </CardContent>
      }
    />
  );
}

export default Policies;
